import { configureStore } from "@reduxjs/toolkit";
import { ipAddressTrackerSlice } from "../ipAddressTrackerSlice/ipAddressTrackerSlice";
import { emailAddressTracker } from "../ipAddressTrackerSlice/emailAddressTrackerSlice";

const store = configureStore({
  reducer: {
    addressTracker: ipAddressTrackerSlice || emailAddressTracker,
  },
});

export default store;
